CREATE DEFINER=`root`@`localhost` FUNCTION `F_GET_HREFBYPARENTID`(vparentid INT,vleaf VARCHAR(2),vvhref VARCHAR(300),vuserid INT) RETURNS varchar(300) CHARSET latin1
BEGIN

    DECLARE vhref varchar(300);

    DECLARE c_href cursor FOR SELECT href FROM BASE_MENUBASE aa,

            (SELECT * FROM BASE_MENU WHERE PARENTID = VPARENTID AND LEAF='2' ORDER BY ORDERCODE, MENUID) T

        WHERE aa.MENUBASEID = T.MENUBASEID

        AND ( (

                EXISTS(SELECT 1 FROM BASE_MENUROLE A,BASE_USERROLE R

                WHERE A.MENUID=T.MENUID AND A.ROLEID = R.ROLEID AND A.USETYPE='0' AND R.USERID = vuserid )

                AND NOT EXISTS (

                    SELECT 1 FROM BASE_MENUROLE A,BASE_USERROLE R

                    WHERE A.MENUID=T.MENUID AND A.ROLEID = R.ROLEID  AND A.USETYPE='1'

                    AND (

                        NOT EXISTS (SELECT 1 FROM BASE_MENUROLE AA, BASE_MENU CC

                        WHERE AA.MENUID = CC.MENUID AND CC.PARENTID = A.MENUID AND AA.ROLEID = R.ROLEID)

                    ) AND R.USERID = 1

                )

            ) OR EXISTS (SELECT 1 FROM BASE_USERROLE R WHERE R.USERID = vuserid AND ROLEID = 1 )

        ) AND aa.FREEZEFLAG = '0' LIMIT 1;

    DECLARE CONTINUE HANDLER FOR NOT FOUND return vvhref;



    IF(vleaf='1') THEN

        OPEN c_href;

        FETCH c_href INTO vhref;

        SET vhref= IFNULL(vhref,vvhref);



        CLOSE c_href;

    ELSE

        SET vhref=vvhref;

    END IF;

    RETURN IFNULL(vhref, vvhref);

END ;;
DELIMITER ;
